result:
 query ($page: Int){
   posts: allStrapiArticles (perPage:2,page: $page) @paginate{
     pageInfo {
       totalPages
       currentPage
     }
     edges{
       node{
         id
         title
         created_at
         published_at
         updated_at
         content
         flags{
           id
           title
         }
       }
     }
   }
general: allStrapiGeneral{
   edges{
     node{
       id
       title
       subtitle
       cover{
         url
       }
     }
   }
 }
 }
